import React from "react";
import { Container, Row, Col, Image } from "react-bootstrap";
import './Skills.css';
import JavaScript from './img/JavaScript.png';
// import HTML from './img/batIcon.png';
import ReactIcon from './img/React.svg';
import Angular from './img/AngularJS.png';
import MySQL from './img/MySQL.png';
import jQuery from './img/jquery.png';
import Sass from './img/Sass.png';


const Skills = () => {
  return (
    <div id="skillsSection">
<h2 class="skillsTitle">
  Skills
</h2>
<Container>
  <Row>
    <Col><Image src={JavaScript} thumbnail /></Col>
    <Col><Image src={ReactIcon} thumbnail /></Col>
    <Col><Image src={Angular} thumbnail /></Col>
  </Row>
  <Row>
    <Col><Image src={MySQL} thumbnail /></Col>
    <Col><Image src={jQuery} thumbnail /></Col>
    <Col><Image src={Sass} thumbnail /></Col>
  </Row>
</Container>
    </div>
  )

}

export default Skills;
